/*-
 * Finite field inversion.
 * Computed with Bernstein-Yang algorithm.
 * https://tches.iacr.org/index.php/TCHES/article/view/8298
 * Based on https://github.com/mit-plv/fiat-crypto/tree/master/inversion/c
 * NB: this is not a real fiat-crypto function, just named that way for consistency.
 */
static inline void fiat_secp256k1_inv(fe_t output, const fe_t t1) {
    int i;
    fe_t v1, r1, v2;
    limb_t *r2 = output;
    limb_t f1[LIMB_CNT + 1], g1[LIMB_CNT + 1], f2[LIMB_CNT + 1],
        g2[LIMB_CNT + 1];
    limb_t d2, d1 = 1;

    fe_copy(g1, t1);
    g1[LIMB_CNT] = 0;
    fe_copy(f1, const_psat);
    f1[LIMB_CNT] = 0;
    fe_copy(r1, const_one);
    fe_set_zero(v1);

    /* 741 divstep iterations */
    for (i = 0; i < 370; i++) {
        fiat_secp256k1_divstep(&d2, f2, g2, v2, r2, d1, f1, g1, v1, r1);
        fiat_secp256k1_divstep(&d1, f1, g1, v1, r1, d2, f2, g2, v2, r2);
    }

    fiat_secp256k1_divstep(&d2, f2, g2, v2, r2, d1, f1, g1, v1, r1);
    fiat_secp256k1_opp(output, v2);
    fiat_secp256k1_selectznz(output, f2[LIMB_CNT] >> (LIMB_BITS - 1), v2,
                             output);
    fiat_secp256k1_mul(output, output, const_divstep);
}

static inline void fiat_nsecp256k1_inv(fe_t output, const fe_t t1) {
  int i;
  fe_t v1, r1, v2;
  limb_t *r2 = output;
  limb_t f1[LIMB_CNT + 1], g1[LIMB_CNT + 1], f2[LIMB_CNT + 1],
      g2[LIMB_CNT + 1];
  limb_t d2, d1 = 1;

  fe_copy(g1, t1);
  g1[LIMB_CNT] = 0;
  fiat_nsecp256k1_msat(f1);
  f1[LIMB_CNT] = 0;
  fiat_nsecp256k1_set_one(r1);
  fe_set_zero(v1);

  /* 741 divstep iterations */
  for (i = 0; i < 370; i++) {
      fiat_nsecp256k1_divstep(&d2, f2, g2, v2, r2, d1, f1, g1, v1, r1);
      fiat_nsecp256k1_divstep(&d1, f1, g1, v1, r1, d2, f2, g2, v2, r2);
  }

  fiat_nsecp256k1_divstep(&d2, f2, g2, v2, r2, d1, f1, g1, v1, r1);
  fiat_nsecp256k1_opp(output, v2);
  fiat_nsecp256k1_selectznz(output, f2[LIMB_CNT] >> (LIMB_BITS - 1), v2,
                           output);
  fiat_nsecp256k1_divstep_precomp(v2);
  fiat_nsecp256k1_mul(output, output, v2);
}

